import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import { zodResolver } from '@hookform/resolvers/zod';
import * as z from 'zod';
import GlassCard from './ui/GlassCard';
import DecryptedText from './ui/DecryptedText';
import SparkButton from './ui/SparkButton';

const schema = z.object({
  leader: z.object({
    name: z.string().min(2, "Name must be at least 2 characters"),
    email: z.string().email("Invalid email format"),
    phone: z.string().min(10, "Phone must be at least 10 digits"),
  }),
  member1: z.object({
    name: z.string().min(2, "Name must be at least 2 characters"),
    email: z.string().email("Invalid email format"),
    phone: z.string().min(10, "Phone must be at least 10 digits"),
  }),
  member2: z.object({
    name: z.string().min(2, "Name must be at least 2 characters"),
    email: z.string().email("Invalid email format"),
    phone: z.string().min(10, "Phone must be at least 10 digits"),
  }),
});

const RegistrationForm = () => {
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [isSuccess, setIsSuccess] = useState(false);

  const { 
    register, 
    handleSubmit, 
    formState: { errors },
    reset 
  } = useForm({
    resolver: zodResolver(schema),
    defaultValues: {
      leader: { name: '', email: '', phone: '' },
      member1: { name: '', email: '', phone: '' },
      member2: { name: '', email: '', phone: '' }
    }
  });

  const onSubmit = async (data) => {
    setIsSubmitting(true);
    try {
      const response = await fetch('/api/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(data)
      });

      const result = await response.json();

      if (result.success) {
        setIsSuccess(true);
        setTimeout(() => {
          setIsSuccess(false);
          reset();
        }, 3000);
      } else {
        alert('Error: ' + result.message);
      }
    } catch (error) {
      alert('Failed to submit registration. Please try again.');
    } finally {
      setIsSubmitting(false);
    }
  };

  const MemberSection = ({ memberKey, title, delay }) => (
    <div className="space-y-4">
      <DecryptedText 
        text={title} 
        className="text-xl font-bold block mb-4"
        delay={delay}
      />
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        <div>
          <input
            {...register(`${memberKey}.name`)}
            placeholder="Full Name"
            className="w-full p-4 rounded-xl bg-hack-navy border border-glass-border 
                     focus:border-cyber-blue-400 focus:ring-2 focus:ring-cyber-blue-400/30
                     text-white placeholder-gray outline-none transition-all duration-300
                     hover:border-neon-blue/50"
          />
          {errors[memberKey]?.name && (
            <p className="text-alert-red text-sm mt-1 font-matrix">
              {errors[memberKey].name.message}
            </p>
          )}
        </div>

        <div>
          <input
            {...register(`${memberKey}.email`)}
            type="email"
            placeholder="Email Address"
            className="w-full p-4 rounded-xl bg-hack-navy border border-glass-border 
                     focus:border-cyber-blue-400 focus:ring-2 focus:ring-cyber-blue-400/30
                     text-white placeholder-gray outline-none transition-all duration-300
                     hover:border-neon-blue/50"
          />
          {errors[memberKey]?.email && (
            <p className="text-alert-red text-sm mt-1 font-matrix">
              {errors[memberKey].email.message}
            </p>
          )}
        </div>

        <div>
          <input
            {...register(`${memberKey}.phone`)}
            placeholder="Phone Number"
            className="w-full p-4 rounded-xl bg-hack-navy border border-glass-border 
                     focus:border-cyber-blue-400 focus:ring-2 focus:ring-cyber-blue-400/30
                     text-white placeholder-gray outline-none transition-all duration-300
                     hover:border-neon-blue/50"
          />
          {errors[memberKey]?.phone && (
            <p className="text-alert-red text-sm mt-1 font-matrix">
              {errors[memberKey].phone.message}
            </p>
          )}
        </div>
      </div>
    </div>
  );

  if (isSuccess) {
    return (
      <div className="min-h-screen flex items-center justify-center px-4">
        <GlassCard className="max-w-lg w-full text-center">
          <DecryptedText 
            text="REGISTRATION SUCCESSFUL" 
            className="text-3xl font-bold text-matrix-green mb-4"
          />
          <DecryptedText 
            text="Your team has been registered for Hack the Matrix!" 
            className="text-lg text-electric-cyan"
            delay={800}
          />
          <div className="mt-8 text-6xl text-matrix-green animate-pulse">
            ✓
          </div>
        </GlassCard>
      </div>
    );
  }

  return (
    <div className="min-h-screen flex items-center justify-center px-4 py-12">
      <GlassCard className="max-w-4xl w-full">
        <form onSubmit={handleSubmit(onSubmit)} className="space-y-8">
          {/* Header */}
          <div className="text-center mb-8">
            <DecryptedText 
              text="TEAM REGISTRATION" 
              className="text-4xl font-bold mb-4"
            />
            <DecryptedText 
              text="Register your team for Hack the Matrix" 
              className="text-lg text-gray"
              delay={600}
            />
          </div>

          {/* Team Leader */}
          <MemberSection 
            memberKey="leader" 
            title="TEAM LEADER" 
            delay={1000}
          />

          {/* Member 1 */}
          <MemberSection 
            memberKey="member1" 
            title="TEAM MEMBER 1" 
            delay={1400}
          />

          {/* Member 2 */}
          <MemberSection 
            memberKey="member2" 
            title="TEAM MEMBER 2" 
            delay={1800}
          />

          {/* Submit Button */}
          <SparkButton className="w-full mt-12">
            <button
              type="submit"
              disabled={isSubmitting}
              className="w-full py-4 rounded-xl font-bold text-lg transition-all duration-300
                       bg-cyber-blue-400 text-hack-black hover:bg-neon-blue
                       hover:shadow-[0_0_40px_rgba(28,171,242,0.8)]
                       disabled:opacity-50 disabled:cursor-not-allowed
                       transform hover:scale-105"
            >
              {isSubmitting ? (
                <DecryptedText text="SUBMITTING..." />
              ) : (
                <DecryptedText text="REGISTER TEAM" delay={2200} />
              )}
            </button>
          </SparkButton>
        </form>
      </GlassCard>
    </div>
  );
};

export default RegistrationForm;
